export default function list(info) {
  console.log(info);

  return <ul>{iterate(info.info)}</ul>;
}

function iterate(data) {
  if (!data) return;
  return data.map((person, index) => {
    return (
      <li>
        <div className="flex">
          <img src={data.img} alt="img" />
          <div className="title">
            <h3 className="name">{data.name}</h3>
            <h5 className="age">{data.birthday}</h5>
          </div>
        </div>
      </li>
    );
  });
}
